import React, {Component} from "react"
import {Redirect} from 'react-router-dom'
import axios from 'axios'


export default class DeleteCar extends Component 
{
    constructor(props) 
    {
        super(props)
          this.state = {
            redirectToDisplayAllCars:false
        }

        axios.delete('http://localhost:4000/cars/delete_car/' + this.props.match.params.id)
             .then(res => this.setState({redirectToDisplayAllCars:true}))
             .catch(error => console.log(error))
    }
  
  
    render() 
    {
        return (
                <div>                    
                  {this.state.redirectToDisplayAllCars ? <Redirect to="/DisplayAllCars"/> : null}                      
                </div>)
    }
}
